import { Component } from "react";

class CartBox extends Component{
	render(){
		const { cart } = this.props
		return(
			<div>
				<ul>
					{cart.map(element=>
						<li key={element.time}>
							{element.time} {element.quantity}
						</li>)}
				</ul>

			</div>
		)
	}

}

export default CartBox
